pragma solidity >=0.4.0 <0.7.0;
pragma experimental ABIEncoderV2;
import "./SafeMath.sol";

// Alvaro --> 0x5B38Da6a701c568545dCfcB03FcB875f56beddC4
// Juan --> 0xAb8483F64d9C6d1EcF9b849Ae677dD3315835cb2
